import React from 'react';
import { Row, Col, Container } from 'reactstrap';
import ProjectDiv from './ProjectDiv';
import ProjectList from '../ProjectList'

const ProjectGrid = () => {
  return (
    <>
    <Container>
      <Row>
        <Col><ProjectDiv title='MOST LIKED' data={ProjectList} context='like'/></Col>
      </Row>
    </Container>
    <Container>
      <Row>
        <Col><ProjectDiv title='MOST ACTIVE' data={ProjectList} context='active'/></Col>
      </Row>
    </Container>
    </>
  )
}

export default ProjectGrid;
